css_global:
#icons-filter-result {display:none}

.input-group {
   width: 100%;
    padding-top: 20px;
    padding-right: 30%;
    padding-left: 30%;
    position: relative;
    margin-bottom: 50px;
    z-index: 1;
}

.breadcrumbs{display:none;}

ul.docs-icons {
    list-style: none;
    margin: 0 -15px -20px;
    padding-bottom: 200px;
}

ul.docs-icons li {
float: left;
  width: 100%;
  margin-bottom: 20px;
  font-size: 16px;
  padding: 0 15px;
}


ul.docs-icons li i {
    position: relative;
    top: 4px;
    margin-right: 10px;
    width: 24px;
    height: 24px;
    text-align: center;
    font-size: 24px;
}

ul.docs-icons li span {
    display: inline-block;
    line-height: 24px;
}

custom_js:
requirejs(['jquery' ],
 function   (jQuery) {
 // jQuery Typing
 (function(f){function l(g,h){function d(a){if(!e){e=true;c.start&&c.start(a,b)}}function i(a,j){if(e){clearTimeout(k);k=setTimeout(function(){e=false;c.stop&&c.stop(a,b)},j>=0?j:c.delay)}}var c=f.extend({start:null,stop:null,delay:400},h),b=f(g),e=false,k;b.keypress(d);b.keydown(function(a){if(a.keyCode===8||a.keyCode===46)d(a)});b.keyup(i);b.blur(function(a){i(a,0)})}f.fn.typing=function(g){return this.each(function(h,d){l(d,g)})}})(jQuery);
     jQuery(document).ready( function($){
         jQuery('#icons-filter').typing({
         stop: function (event, $elem) {
             var filterValue = $elem.val(),
             count = 0;

             if( $elem.val() ) {
                 $(".docs-icons li").each(function(){
                     if ($(this).text().search(new RegExp(filterValue, "i")) < 0) {
                         $(this).fadeOut();
                     } else {
                     $(this).show();
                         count++
                     }
                 });

                 if( count > 0 ) {
                     $('#icons-filter-result').html('<strong>' + count + '</strong> Icons Found.');
                 } else {
                     $('#icons-filter-result').html('No Icons Found.');
                 }

                 } else {
                     $(".docs-icons li").show();
                     $('#icons-filter-result').html('');
                 }

                 count = 0;
             },
             delay: 500
         });

     });
 });
